import React, { useState, useEffect } from "react";
import { Row, Col, Button, Typography, Progress } from "antd";
import { useRouter } from "next/router";
const { Text, Paragraph } = Typography;
import storage from "../../back/cloudStorage";
import { FacebookProvider, Share, ShareButton } from "react-facebook";

import {
	halfCol,
	fullCol,
	centerCol,
	HeightImg,
	WidthImg,
	Texty,
} from "../../assets/css/style_result";
import Feature from "../../components/Feature";

import firebase from "../../back/firebase";

const End = () => {
	const [imgUrl, setImgUrl] = useState(null);
	const router = useRouter();

	const toTop = () => {
		router.push("/");
	};

	const toKakao = () => {
		console.log("func toKakao");
		Kakao.Link.sendDefault({
			objectType: "feed",
			content: {
				title: "딸기 치즈 케익",
				description: "#케익 #딸기 #삼평동 #카페 #분위기 #소개팅",
				imageUrl:
					"http://k.kakaocdn.net/dn/Q2iNx/btqgeRgV54P/VLdBs9cvyn8BJXB3o7N8UK/kakaolink40_original.png",
				link: {
					mobileWebUrl: "https://developers.kakao.com",
					webUrl: "https://developers.kakao.com",
				},
			},
			social: {
				likeCount: 286,
				commentCount: 45,
				sharedCount: 845,
			},
			buttons: [
				{
					title: "웹으로 보기",
					link: {
						mobileWebUrl: "https://developers.kakao.com",
						webUrl: "https://developers.kakao.com",
					},
				},
				{
					title: "앱으로 보기",
					link: {
						mobileWebUrl: "https://developers.kakao.com",
						webUrl: "https://developers.kakao.com",
					},
				},
			],
		});
	};

	useEffect(() => {
		storage
			.ref()
			.child("ENTP_saveable.png")
			.getDownloadURL()
			.then((url) => {
				setImgUrl(url);
			})
			.catch((err) => {
				return;
			});

		try {
			Kakao.init("a5394119fa694f305316c59293958f9d");
		} catch (err) {
			console.log("Catch error");
			console.log(err);
			console.log(Kakao);
		}
	});

	return (
		<>
			<Row justify="center">
				<Texty top={50} font={15}>
					나의 유형은
				</Texty>
			</Row>
			<Row justify="center">
				<Texty strong top={5} font={25}>
					(여기에 유형 입력)
				</Texty>
			</Row>
			<Row justify="center">
				<Texty strong top={5} font={30} color={"#be2edd"}>
					ENTP
				</Texty>
			</Row>
			<Row justify="center">
				<Col {...centerCol}>
					<WidthImg src={require("../../assets/images/dog.png")} />
				</Col>
			</Row>
			<Feature title={"애정표현력"} value={40} />
			<Feature title={"눈치력"} value={40} />
			<Feature title={"썸추진력"} value={60} />
			<Feature title={"19금력"} value={40} />
			<Feature title={"마이웨이력"} value={100} color={"#eb4d4b"} />
			<Row justify="center">
				<Col {...fullCol}>
					<Paragraph
						strong
						style={{
							textAlign: "center",
							display: "block",
							marginTop: "45px",
							marginBottom: "45px",
							fontSize: "15px",
						}}
					>
						당신은 이러이러한 사람이에요.
						~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
					</Paragraph>
				</Col>
			</Row>
			<Row justify="center">
				<Col {...halfCol}>
					<Row>
						<Button
							type="link"
							style={{ height: "100%" }}
							justify="center"
						>
							<WidthImg
								src={require("../../assets/images/cat.png")}
							/>
							환상유형
						</Button>
					</Row>
					<Row justify="center">
						<Text>환상의 케미</Text>
					</Row>
				</Col>
				<Col xs={3} sm={3} md={3} lg={3} xl={3}></Col>
				<Col {...halfCol}>
					<Row>
						<Button
							type="link"
							style={{ height: "100%" }}
							justify="center"
						>
							<WidthImg
								src={require("../../assets/images/cat.png")}
							/>
							환장유형
						</Button>
					</Row>
					<Row justify="center">
						<Text>환장의 케미</Text>
					</Row>
				</Col>
			</Row>

			<Row justify="center">
				<Col {...fullCol}>
					<Button
						style={{
							display: "block",
							marginTop: "40px",
							width: "100%",
							height: "40px",
						}}
						onClick={toTop}
					>
						다시 해보기!
					</Button>
				</Col>
			</Row>

			<Row justify="center">
				<Col xs={7} sm={7} md={4} lg={4} xl={4}>
					<a
						href={imgUrl}
						download
						style={{
							display: "block",
							marginTop: "40px",
							width: "100%",
							height: "40px",
						}}
					>
						<Texty font={15}>이미지 저장</Texty>
					</a>
				</Col>
				<Col xs={1} sm={1} md={1} lg={1} xl={1}></Col>
				<Col xs={7} sm={7} md={4} lg={4} xl={4}>
					<Button
						style={{
							display: "block",
							marginTop: "40px",
							width: "100%",
							height: "40px",
						}}
						onClick={toKakao}
					>
						<Texty font={15}>카카오 공유</Texty>
					</Button>
				</Col>
				<Col xs={1} sm={1} md={1} lg={1} xl={1}></Col>
				<Col xs={7} sm={7} md={4} lg={4} xl={4}>
					<FacebookProvider appId="3621305641226627">
						<ShareButton
							href="https://mbti-bf18c.web.app/results/ENTP"
							style={{
								display: "block",
								marginTop: "40px",
								width: "100%",
								height: "40px",
								background: "#0000FF",
								color: "#FFFFFF",
							}}
						>
							<Texty font={15}>페이스북 공유</Texty>
						</ShareButton>
					</FacebookProvider>
				</Col>
			</Row>

			<Row style={{ height: "400px" }}></Row>
		</>
	);
};

export default End;
